コクがある味わいなので、お鍋はもちろん、〆まで美味しく食べられる鍋つゆシリーズです。<br>ごま油と鶏油で炒めたニンニクと韓国産唐辛子に、コチュジャン・ラージャン(熟成唐辛子)を加えたキムチ鍋つゆです。<br>〆はラーメンを入れてキムチラーメンを美味しくいただけます。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ミツカン<br>シリーズ名：〆まで美味しい<br>内容量：750g<br>原材料名：アミノ酸液、果糖ぶどう糖液糖、みそ、食塩、醸造酢、魚醤(魚介類)、にんにく、唐辛子、ごま油、コチュジャン、ラージャン、たん白加水分解物、鶏脂、ポーク・チキン香味オイル、煮干し粉末、酵母エキ<br>ス加工品、調味料(アミノ酸等)、パプリカ色素、増粘剤(キサンタンガム)<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4902106649731 SH5417 ミツカン みつかん 食品 しょくひん 鍋つゆ なべ 鍋 鍋スープ スープ 鍋の素 なべの素 素 キムチ鍋つゆ キムチ キムチつゆ きむち鍋 ストレート すとれーと 750g</font></td></tr></table><style type="text/css">
