コクがある味わいなので、お鍋はもちろん、〆まで美味しく食べられる鍋つゆシリーズです。<br>地鶏の鶏がらスープに、米味噌と豆味噌を合わせてあっさり仕上げました。<br>だしに「地鶏」を使用し「だしの旨み」と「味噌の旨み」がある、スープのやさしい味わいが特徴のあっさりしていてコクがある「味噌ちゃんこ鍋つゆ」です。<br>〆はチーズとご飯を入れてチーズリゾットを美味しくいただけます。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ミツカン<br>シリーズ名：〆まで美味しい<br>内容量：750g<br>原材料名：みそ、水あめ、食塩、香味食用油、鶏がらだし、しょうが、コラーゲンペプチド、煮干し粉末、酵母エキス、発酵調味料、酵母エキス加工品、調味料(アミノ酸等)、増粘剤(キサンタンガム)、香料、(原材料<br>の一部に小麦、ゼラチンを含む)<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4902106648697 SH5418 ミツカン みつかん 食品 しょくひん 鍋つゆ なべ 鍋 鍋スープ スープ 鍋の素 なべの素 素 濃厚味噌 濃厚 のうこう味噌 味噌 みそ 味噌鍋つゆ みそなべ 750g</font></td></tr></table><style type="text/css">
